create table FsZakelijkeProducts
(
    id           int auto_increment
        primary key,
    productnaam  varchar(50)                          not null,
    productcode  varchar(50)                          not null,
    productprijs varchar(50)                          null,
    voorraad     varchar(50)                          null,
    productfoto  longblob                             null,
    createdAt    datetime default current_timestamp() null,
    updatedAt    datetime default current_timestamp() null
);

